import noteConext from "../context/notes/NoteContext"
import React, { useContext } from 'react'

const List = () => {

const context = useContext(noteConext);
const {notes, setNotes} = context;

  return (
    <div>
         {notes.map((notes) => {
            return notes.title;
          })}
    </div>
  )
}

export default List
